                    "text": {
                        "TEXT": "\nColumn\nkeys\nare\ngrouped\ninto\nsets\ncalled\ncolumn\nfami-\nlies\n, which\nform\nthe\nbasic\nunit\nof\naccess\ncontrol.\nAll\ndata\nstored\nin a column\nfamily\nis usually\nof\nthe\nsame\ntype\n(we\ncompress\ndata\nin\nthe\nsame\ncolumn\nfamily\ntogether)."
                    },
